import logo from './logo.svg';
import './App.css';
import GetProductos from './components/GetProductos';
import CrearProducto from './components/CrearProducto';
import { BrowserRouter, Route, Routes } from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
        {/* cada ruta tiene dos partes la url y el componente que se va a renderizar */}
          <Route path="/productos" element={<GetProductos/>}/> 
          <Route path='/crearProducto' element={<CrearProducto/>}></Route>
        </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
